import React from 'react'
import styles from '../styles/Champ.scss'

const ChampContainer = ({data}) => {
    console.log("props",data);
    return (
        <div className={styles.Main}>

            {data.id}
            {' '}
            {data.title}
        </div>
    )
}

export default ChampContainer
